export async function getVans() {
    const res = await fetch("/api/vans")
    if (!res.ok) {
        const error = {
            message: "Failed to fetch vans",
            statusText: res.statusText,
            status: res.status,
        }
        throw error;
    }
    const data = await res.json()
    return data.vans
}
